# Definition for singly-linked list.
class ListNode(object):
    def __init__(self, x):
        self.val = x
        self.next = None

class Solution(object):
    def sortList(self, head):
        """
        :type head: ListNode
        :rtype: ListNode
        """
        if head == None or head.next == None:
            return head
        mid = head
        end = head
        prev = None
        while end != None and end.next != None:
            prev = mid
            mid = mid.next
            end = end.next.next
        prev.next = None
        
        head = self.sortList(head)
        mid = self.sortList(mid)
        head = self.merge(head, mid)
        return head

    def merge(self, l1, l2):
        sortedList = ListNode(-1)
        t = sortedList
        while l1 != None and l2 != None:
            if l1.val < l2.val:
                t.next = l1
                l1 = l1.next
            else:
                t.next = l2
                l2 = l2.next
            t = t.next
        if l1 != None:
            t.next = l1
        else:
            t.next = l2
        return sortedList.next

def printList(result):
    s = ""
    while result != None:
        s += str(result.val) + " "
        result = result.next
    print(s)

